&lt;p&gt;
Fluoropolymer tubing series TH is available in 4 color variations (translucent, black, red, blue) and 8 size variations. Applicable fittings include high purity fluoropolymer fittings series LQ, One-touch fittings series KQ2, KJ, miniature fittings series M, MS and insert fittings series KF. Applicable applications include food, medical care, semiconductor, automobile and general pneumatic piping.
&lt;/p&gt;

